import "./App.scss";
import moment from "moment";

function App() {
  return (
    <div className="App">
      <TimePicker defaultValue={moment("13:30:56", "HH:mm:ss")} />;
      <h1>aplicacion web george</h1>
      <h2>pruebas</h2>
    </div>
  );
}

export default App;
